import React from 'react';

import { Route } from 'react-router-dom';

const Header = () => {
  return <h2>Why</h2>
};

class App extends React.Component {

  render () {

    //JSX
    return (
    <div>
      <Route path = '/why' Component = {Header}/>
    </div>
    );
  }
}

export default App;
